import React from "react";
import {about} from './About.module.css';

function About() {
  return (
    <div className={about}>
      <p>
        Hola. Mi nombre es Julián Alvarez Windey, y soy el PADRE de esta página.
        Así es, yo y solo yo desarrollé esta MAGNÍFICA obra de arte.
      </p>
    </div>
  )
}

export default About;
